function Demo(){

    const countries =['india','australia','america'];
    const results=[];
    if(countries.length>0){
        // countries.forEach((country)=>{
        //     results.push(
        //         <div >

        //         <p>{country}</p>
        //         </div>,
        //     );
        // });


    for(let country of countries ){
        results.push(
            <div>
            <p>{country}</p>
            </div>
        );
    }
}
return 
    <div>{results.length>0 ? results : <p>No data!!!</p>}</div>;


}
export default Demo;
